import React from "react";

function Main() {
  return (
    <div className="main">
      <section>
        <div className="home"></div>
        <div className="about-me"></div>
        <div className="projects"></div>
        <div className="services"></div>
        <div className="contact-me"></div>
      </section>
    </div>
  );
}

export default Main;
